import React from 'react';

import {BrowserRouter,Route,Routes} from "react-router-dom";
//import Administration from './components/admin/admin';
import Login from './components/login/login';

function App() {
return(
<div className='App'>
<BrowserRouter>
<Routes>

<Route path="/login" element={<Login/>}/> 
<Route path="/login" element={<Login/>}/> 



</Routes>



</BrowserRouter>



</div>
)


}
export default App
